import { default as BasicLayout, default as ProLayout } from './BasicLayout';
import FooterToolbar from './components/FooterToolbar';
import GridContent from './components/GridContent';
import PageContainer, { ProBreadcrumb, ProPageHeader } from './components/PageContainer';
import PageLoading from './components/PageLoading';
import SettingDrawer from './components/SettingDrawer';
import TopNavHeader from './components/TopNavHeader';
import WaterMark from './components/WaterMark';
import DefaultFooter from './Footer';
import getPageTitle from './getPageTitle';
import DefaultHeader from './Header';
import RouteContext from './RouteContext';
import getMenuData from './utils/getMenuData';
export { ProLayout, BasicLayout, RouteContext, PageLoading, GridContent, DefaultHeader, TopNavHeader, DefaultFooter, SettingDrawer, getPageTitle, PageHeaderWrapper, getMenuData, PageContainer, FooterToolbar, WaterMark, ProPageHeader, ProBreadcrumb };
var PageHeaderWrapper = PageContainer;
export default BasicLayout;
